export function IconUser({ iconId }) {
  const getIconById = (id) => {
    const icon = icons.find((icon) => icon.id === id);
    return icon ? icon.img : null;
  };

  return (
    <div className="icon-user">
      {getIconById(iconId)}
    </div>
  );
}

export function ChooseYourIcon({ onValueChange }) {

    const [estActif, setEstActif] = useState(false);
  
    const handleContainerIcon = () => {
      setEstActif(!estActif);
    };
  
    const handleChangeIcon = (id) => {
      onValueChange(id);
    };
  
    return (
      <div className='container-cursor' onClick={handleContainerIcon}>
        <svg className='cursor-user' width="50" height="50" viewBox="0 0 50 50" fill="none" xmlns="http://www.w3.org/2000/svg">
          <path d="M35.1292 9.34794L38.6437 5.83128C39.3764 5.09862 40.3701 4.68701 41.4062 4.68701C42.4424 4.68701 43.4361 5.09862 44.1687 5.83128C44.9014 6.56394 45.313 7.55764 45.313 8.59378C45.313 9.62992 44.9014 10.6236 44.1687 11.3563L14.2333 41.2917C13.1319 42.3925 11.7737 43.2015 10.2812 43.6459L4.6875 45.3125L6.35417 39.7188C6.79849 38.2263 7.60757 36.8681 8.70833 35.7667L35.1313 9.34794H35.1292ZM35.1292 9.34794L40.625 14.8438" stroke="black" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round"/>
        </svg>
  
        <div className={`container-icon ${estActif ? "active" : "inactive"}`}>
          {icons.map((icon) => (
            <span className='icon-cursor' key={icon.id} onClick={() => handleChangeIcon(icon.id)}>
              {icon.img}
            </span>
          ))}
        </div>
      </div>
    );
}